import { StyleSheet } from "react-native";
const styles=StyleSheet.create({
    header:{
        fontSize:23,
        color:"red",
        width:'100%',
        textAlign:"center",
        marginTop:"30"
    },
    child:{
        alignItems:"center",
        display:"flex",
        flexDirection:"row"
    }
});

export default styles;
